import 'package:equatable/equatable.dart';class UserMd extends Equatable {  int userId;  String email;  String passwordHash;  String firstName;  String lastName;  bool isAdmin;  DateTime createdAt;  String phoneNumber;  UserMd({    required this.userId,    required this.email,    required this.passwordHash,    required this.firstName,    required this.lastName,    required this.isAdmin,    required this.createdAt,    required this.phoneNumber,  });  @override  List<Object?> get props => [        userId,        email,        passwordHash,        firstName,        lastName,        isAdmin,        createdAt,        phoneNumber,      ];  factory UserMd.fromJson(Map<String, dynamic> json) {    try {      return UserMd(        userId: json['user_id'],        email: json['email'],        passwordHash: json['password_hash'],        firstName: json['first_name'],        lastName: json['last_name'],        isAdmin: json['is_admin'],        createdAt: DateTime.parse(json['created_at']),        phoneNumber: json['phone_number'],      );    } on TypeError catch (e, st) {      print("Error: $e, $st");      rethrow;    }  }  Map<String, dynamic> toJson() {    return {      'user_id': userId,      'email': email,      'password_hash': passwordHash,      'first_name': firstName,      'last_name': lastName,      'is_admin': isAdmin,      'created_at': createdAt.toIso8601String(),      'phone_number': phoneNumber,    };  }}